function CSV_item.GetValue(index, key)
	index = tostring(index)
	key = tostring(key)
    if item[index] == nil then
        ZLog.Logger("Excel 获取表:item  主键:".. index .." key:".. key.."出错!")
        return nil
    end
    if item[index][key] == nil then
        ZLog.Logger("Excel 获取表: item  主键:".. index .." key:".. key.."出错!")
        return nil
    end

    return item[index][key]
end


function CSV_item.Get()
    return item
end

function CSV_item.GetAllKeys()
    local keys = {}
    for k in pairs(item) do
        keys[#keys + 1] = k
    end
    if #keys == 0 then
        ZLog.Logger(string.format("Excel 获取表: 所有主键出错"))
        return nil
    end
    return keys
end